import React from "react";
import "../styles/navbarS.css"
import Rostelecom_logo from "../assets/Rostelecom_logo.png"

function navbarS() {
  return (
    <header>
        <img src={Rostelecom_logo} alt="Rostelecom_logo"/>
    </header>
  )
}

export default navbarS;
